// import Router from "./routes";
import React, { Suspense } from "react";
const Router = React.lazy(() => import("./routes"));
function App() {
  return (
    <div>
      <Suspense fallback={<div>Loading...</div>}>
        <Router />
      </Suspense>
    </div>
  );
}

export default App;
